import {
    createAction
}
from "../functions/createAction";

const onAddChar = createAction({
    name: "ON_ADD_CHAR",
    payload: [
        "char"
    ]
});

const onAddMath = createAction({
    name: "ON_ADD_MATH",
    payload: [
        "value"
    ]
});

const onSubtractMath = createAction({
    name: "ON_ADD_MATH",
    payload: [
        "value"
    ]
});

const onMultipleMath = createAction({
    name: "ON_ADD_MATH"
});

const onDivideMath = createAction({
    name: "ON_ADD_MATH"
});

export {
    onAddChar,
    onAddMath,
    onSubtractMath,
    onMultipleMath,
    onDivideMath
}
